        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        textAlign: 'center',
        marginBottom: '100px',
        maxWidth: '1200px'
    }


    return ( 
        <section style={hero}>
            <div style={mainTitleHero}>
                <h1 className="fs-display">Bring your token to the moon with the perfect Shiller.</h1>
            </div>
        </section>
    );
}

export default LandingPage;
